    const[requestError,setRequestError]=useState();

    const token= getToken();
    const userApi = 'https://10.100.17.47/FairEx/api/v1/admin/userList'
 
    axios.interceptors.request.use(
        config =>{
            config.headers.authorization= `Bearer ${token}`;
            return config
        }
    )

